import {Container} from "reactstrap";
import logo from './../../assets/images/logo.png'

const Header = () => {
    return (
        <header className="header">
            <Container>
                <div className="nav_wrapper">
                    <div className="logo">
                        <img src={logo} alt='logo'/>
                        <h5>Пицца-огонь!</h5>
                    </div>

                    {/*======Меню======*/}

                    <div className="navigation">

                    </div>
                </div>
            </Container>
        </header>
    );
}

export default Header;
